import React from 'react';
import EmployeeData from './EmployeeData'

const EmployeesList= () =>{
    return(
        <>

<table className='styled-table'>
    <thead>
        <tr>
            <th>Code</th>
            <th>Name</th>
            <th>Designation</th>
            <th>Action</th>
        </tr>
    </thead>
    <tbody>
        {
            EmployeeData.map((employee)=>{
                return(
                <>
               <tr>
                <td>{employee.code}</td>
                <td>{employee.Name}</td>
                <td>{employee.Designation}</td>
                <td><a href='#' data-attr={employee.id}>Update</a> <a href='#'>delete</a></td>
                </tr>
                </>
                )
            })
        }
       

    </tbody>
</table>

        </>
    )
}


export default EmployeesList;
